import React, { Component } from 'react';
import './App.css';
import Button from './components/Button';
import Hero from './components/Hero';
import Nav from './components/Nav';



class App extends Component {
  render() {
    return (
      <div className="App">
        <Nav />
        <Hero />
        <Button test="just" name="Awesome" />
      </div>
    );
  }
}

export default App;
